import { useState } from 'react'

import React from 'react'

export default function CountComponent() {
    const [counting,setCount] =useState(1)

    const counthandler=()=>{

        setCount(counting + 15)
        
    }
  return (
    <>
    <div>
        {counting}
    </div>
    <button type="button" onClick={counthandler}>Count Me</button>
    </>
  )
}
